import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import  {ThemeProvider} from'./ModeContext'
// 1. import `ChakraProvider` component
import { ChakraProvider } from '@chakra-ui/react'
ReactDOM.render(
  <ChakraProvider>
  <ThemeProvider>
    <App />
    </ThemeProvider>
    </ChakraProvider>,
  document.getElementById('root')
);

